import { useState } from "react";
import Login from "./login";
import Register from "./register";

function SwitchTabs() {
    const [isLogin, setTab] = useState(true);
    const loginTab = () => {
        setTab(true);
    }
    const registerTab = () => {
        setTab(false);
    }
    return (<div>
        <div style={{marginTop:50}}>
            <center>
            <button onClick={loginTab} style={{height:40, width:250, fontSize:20, backgroundColor:'white', border:"1px solid black",borderBottom:'none', borderLeft:"0.5px solid black"}}>Login</button>
            <button onClick={registerTab} style={{height:40, width:250, fontSize:20, backgroundColor:'white', border:"1px solid black",borderLeft:"none", borderBottom:"none"}}>Register</button>
            </center>
            {
                isLogin ?
                <div> <Login/> </div>
                :
                <div><Register/></div>
            }
        </div>
        </div>
    )
}
export default SwitchTabs;
